import React from "react";
//"container text-start bg-dark text-warning" style={{ marginTop: "70px" }}
const LaunchItem = (props) => {
  return (
    <>
      <div
        className="card container text-start bg-dark text-warning"
        style={{ width: "400px", height: "450px", marginTop: "70px" }}
      >
        <img
          className="card-img-top"
          src={props.img}
          alt="Card image"
          style={{ width: "340px", height: "250px" }}
        />
        <div className="card-body">
          <h4 className="card-title">{props.name}</h4>
          <p className="card-text">
            {props.details === null
              ? "CRS-1 successful, but the secondary payload was inserted into abnormally low orbit and lost due to "
              : props.details.slice(0, 100)}
          </p>
          <a href="#" className="btn btn-primary mb-0">
            See Profile
          </a>
        </div>
      </div>
      <br />
    </>
  );
};

export default LaunchItem;
